import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Userhome.css';

const UserHomePage = () => {
  const [user, setUser] = useState({
    name: '',
    email: '',
    contact: ''
  });

  const [policies, setPolicies] = useState([]);
  const [myPolicies, setMyPolicies] = useState([]);

  useEffect(() => {
    // Fetch user details and policies on component mount
    // axios.get('http://localhost:8080/userdetails')
    //   .then(response => {
    //     setUser(response?.data?.user);
    //   })
    //   .catch(err => console.log(err));

    axios.get('http://localhost:8080/user/policy')
      .then(response => {
        setPolicies(response?.data?.policies);
      })
      .catch(err => console.log(err));
  }, []);



    const handleAddToMyPolicies = (policyId) => {
      // Find the policy to add to "My Policies"
      const policyToAdd = policies.find(policy => policy.policyId === policyId);

      // Update the policy to indicate it has been added to "My Policies"
      const updatedPolicies = policies.map(policy => {
        if (policy.policyId === policyId) {
          return { ...policy, isAdded: true };
        }
        return policy;
      });

      // Update the state with the modified policy
      setPolicies(updatedPolicies);

      // Add policy to "My Policies"
      setMyPolicies([...myPolicies, policyToAdd]);
    };



  return (
    <div className="user-home-page">
      {/* Dashboard */}
      <aside className="dashboard">
        <h2>Dashboard</h2>
        <ul>
          <li>My Policies</li>
          <li>Make Claim</li>
          <li>History</li>
        </ul>
      </aside>

      {/* User Information */}
      <section className="user-information">
        <h2>User Information</h2>
        <div>
          <strong>Name:</strong> {user.name}<br />
          <strong>Email:</strong> {user.email}<br />
          <strong>Contact:</strong> {user.contact}<br />
        </div>
      </section>

      {/* Policies Table */}
      <main className="policies-table">
        <h2>All Policies</h2>
        <table>
          <thead>
            <tr>
              <th>Policy ID</th>
              <th>Policy Name</th>
              <th>Actions</th>
              <th>Premium Amount</th>
              <th>Coverage Amount</th>
            </tr>
          </thead>
          <tbody>
            {policies.map(policy => (
              <tr key={policy.policyId}>
                <td>{policy.policyId}</td>
                <td>{policy.name}</td>
                <td>{policy.premiumAmount}</td>
                <td>{policy.coverageAmount}</td>
                <td>
                  <button
                    className="add-to-my-policies"
                    onClick={() => handleAddToMyPolicies(policy.policyId)}
                  >
                    Add to My Policies
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </main>
    </div>
  );
};

export default UserHomePage;
